public void assertQueryEquals(CommonQueryParserConfiguration cqpC, String field, String query, String result) 
  throws Exception {
  Query q = getQuery(query, cqpC);
  String s = q.toString(field);
  if (!s.equals(result)) {
    fail("Query /" + query + "/ yielded /" + s
         + "/, expecting /" + result + "/");
  }
}

